La concurrencia más simple para un programa embebido es la no concurrencia: tu software consiste en un único bucle principal que sigue corriendo, y no hay interrupciones en absoluto. A veces esto es perfectamente adecuado para el problema en cuestión. Normalmente, el bucle leerá algunas entradas, realizará algún procesamiento y escribirá algunas salidas. #[entry]
fn main() { let peripherals = setup_peripherals(); loop { let inputs = read_inputs(&peripherals); let outputs = process(inputs); write_outputs(&peripherals, outputs); }
} Como no hay concurrencia, no hay necesidad de preocuparse por compartir datos entre partes de tu programa o sincronizar el acceso a los periféricos. Si puedes salirte con la tuya con un enfoque tan simple esta puede ser una gran solución.

111.body:
A diferencia del Rust no embebido, normalmente no tendremos el lujo de crear asignaciones de heap y pasar referencias a esos datos a un hilo recién creado. En su lugar, nuestros manejadores de interrupciones pueden ser llamados en cualquier momento y deben saber cómo acceder a cualquier memoria compartida que estemos utilizando. En el nivel más bajo, esto significa que debemos tener memoria mutable asignada estáticamente , a la que tanto el manejador de interrupciones como el código principal puedan referirse. En Rust, tales variables static mut son siempre inseguras para leer o escribir, porque sin tener especial cuidado, podrías provocar una condición de carrera, donde tu acceso a la variable es interrumpido a mitad de camino por una interrupción que también accede a esa variable. Para un ejemplo de cómo este comportamiento puede causar errores sutiles en tu código, considera un programa embebido que cuenta los flancos ascendentes de alguna señal de entrada en cada periodo de un segundo (un contador de frecuencia): static mut COUNTER: u32 = 0; #[entry]
fn main() -> ! { set_timer_1hz(); let mut last_state = false; loop { let state = read_signal_level(); if state && !last_state { // DANGER - Not actually safe! Could cause data races. unsafe { COUNTER += 1 }; } last_state = state; }
} #[interrupt]
fn timer() { unsafe { COUNTER = 0; }
} Cada segundo, la interrupción del temporizador vuelve a poner el contador a 0. Mientras tanto, el bucle principal mide continuamente la señal, e incrementa el contador cuando ve un cambio de bajo a alto. Hemos tenido que usar unsafe para acceder a COUNTER, ya que es static mut, y eso significa que estamos prometiendo al compilador que no causaremos ningún comportamiento indefinido. ¿Puedes detectar la condición de carrera? El incremento en COUNTER no está garantizado que sea atómico - de hecho, en la mayoría de las plataformas embebidas, se dividirá en una carga, luego el incremento, y luego un almacenamiento. Si la interrupción se disparara después de la carga pero antes del almacenamiento, el reset a 0 sería ignorado después de que la interrupción volviera - y contaríamos el doble de transiciones para ese periodo.

