Entonces, ¿qué podemos hacer con las carreras de datos? Un enfoque sencillo es utilizar secciones críticas , un contexto en el que las interrupciones están deshabilitadas. Envolviendo el acceso a COUNTER en main en una sección crítica, podemos estar seguros de que la interrupción del temporizador no se disparará hasta que hayamos terminado de incrementar COUNTER: static mut COUNTER: u32 = 0; #[entry]
fn main() -> ! { set_timer_1hz(); let mut last_state = false; loop { let state = read_signal_level(); if state && !last_state { // New critical section ensures synchronised access to COUNTER cortex_m::interrupt::free(|_| { unsafe { COUNTER += 1 }; }); } last_state = state; }
} #[interrupt]
fn timer() { unsafe { COUNTER = 0; }
} En este ejemplo, usamos cortex_m::interrupt::free, pero otras plataformas tendrán mecanismos similares para ejecutar código en una sección crítica. Esto también es lo mismo que desactivar las interrupciones, ejecutar algo de código, y luego volver a activar las interrupciones. Observa que no necesitamos poner una sección crítica dentro de la interrupción del temporizador, por dos razones: Escribir 0 en COUNTER no puede verse afectado por una carrera ya que no lo leemos. De todas formas nunca será interrumpido por el hilo `main Si COUNTER estuviera siendo compartido por múltiples manejadores de interrupción que pudieran prevenir a cada uno, entonces cada uno podría requerir una sección crítica también. Esto resuelve nuestro problema inmediato, pero seguimos escribiendo mucho código inseguro sobre el que tenemos que razonar cuidadosamente, y podríamos estar usando secciones críticas innecesariamente. Dado que cada sección crítica pausa temporalmente el procesamiento de interrupciones, hay un costo asociado de algún tamaño de código extra y mayor latencia de interrupción y jitter (las interrupciones pueden tardar más en ser procesadas, y el tiempo hasta que son procesadas será más variable). Que esto sea un problema depende de tu sistema, pero en general, nos gustaría evitarlo. Vale la pena señalar que, si bien una sección crítica garantiza que no se produzcan interrupciones, ¡no proporciona una garantía de exclusividad en sistemas multinúcleo! El otro núcleo podría estar accediendo felizmente a la misma memoria que tu núcleo, incluso sin interrupciones. Necesitarás primitivas de sincronización más fuertes si estás usando múltiples núcleos.

113.body:
En algunas plataformas existen instrucciones atómicas especiales que garantizan las operaciones de lectura-modificación-escritura. Específicamente para Cortex-M: thumbv6 (Cortex-M0, Cortex-M0+) sólo proporciona instrucciones atómicas de carga y almacenamiento, mientras que thumbv7 (Cortex-M3 y superiores) proporciona instrucciones completas de Comparación e Intercambio (CAS). Estas instrucciones CAS ofrecen una alternativa a la pesada deshabilitación de todas las interrupciones: podemos intentar el incremento, que tendrá éxito la mayoría de las veces, pero si se interrumpe se reintentará automáticamente toda la operación de incremento. Estas operaciones atómicas son seguras incluso en múltiples núcleos. use core::sync::atomic::{AtomicUsize, Ordering}; static COUNTER: AtomicUsize = AtomicUsize::new(0); #[entry]
fn main() -> ! { set_timer_1hz(); let mut last_state = false; loop { let state = read_signal_level(); if state && !last_state { // Use `fetch_add` to atomically add 1 to COUNTER COUNTER.fetch_add(1, Ordering::Relaxed); } last_state = state; }
} #[interrupt]
fn timer() { // Use `store` to write 0 directly to COUNTER COUNTER.store(0, Ordering::Relaxed)
} Esta vez COUNTER es una variable static segura. Gracias al tipo AtomicUsize COUNTER puede modificarse de forma segura tanto desde el manejador de interrupciones como desde el hilo principal sin desactivar las interrupciones. Cuando sea posible, esta es la mejor solución - pero puede que no esté soportada en tu plataforma. Una nota sobre Ordering : esto afecta a cómo el compilador y el hardware pueden reordenar las instrucciones, y también tiene consecuencias sobre la visibilidad de la caché. Asumiendo que el objetivo es una plataforma mononúcleo, Relaxed es suficiente y la opción más eficiente en este caso particular. Un ordenamiento más estricto hará que el compilador emita barreras de memoria alrededor de las operaciones atómicas; ¡dependiendo de para qué uses las atómicas puedes necesitarlo o no! Los detalles precisos del modelo atómico son complicados y es mejor describirlos en otro lugar. Para más detalles sobre atómicos y ordenación, vea el nomicon .

