Ninguna de las soluciones anteriores es especialmente satisfactoria. Requieren bloques "inseguros" que deben ser comprobados cuidadosamente y no son ergonómicos. ¡Seguramente podemos hacerlo mejor en Rust! Podemos abstraer nuestro contador en una interfaz segura que pueda ser utilizada con seguridad en cualquier otra parte de nuestro código. Para este ejemplo, usaremos el contador de sección crítica, pero podrías hacer algo muy similar con atomics. use core::cell::UnsafeCell;
use cortex_m::interrupt; // Our counter is just a wrapper around UnsafeCell<u32>, which is the heart
// of interior mutability in Rust. By using interior mutability, we can have
// COUNTER be `static` instead of `static mut`, but still able to mutate
// its counter value.
struct CSCounter(UnsafeCell<u32>); const CS_COUNTER_INIT: CSCounter = CSCounter(UnsafeCell::new(0)); impl CSCounter { pub fn reset(&self, _cs: &interrupt::CriticalSection) { // By requiring a CriticalSection be passed in, we know we must // be operating inside a CriticalSection, and so can confidently // use this unsafe block (required to call UnsafeCell::get). unsafe { *self.0.get() = 0 }; } pub fn increment(&self, _cs: &interrupt::CriticalSection) { unsafe { *self.0.get() += 1 }; }
} // Required to allow static CSCounter. See explanation below.
unsafe impl Sync for CSCounter {} // COUNTER is no longer `mut` as it uses interior mutability;
// therefore it also no longer requires unsafe blocks to access.
static COUNTER: CSCounter = CS_COUNTER_INIT; #[entry]
fn main() -> ! { set_timer_1hz(); let mut last_state = false; loop { let state = read_signal_level(); if state && !last_state { // No unsafe here! interrupt::free(|cs| COUNTER.increment(cs)); } last_state = state; }
} #[interrupt]
fn timer() { // We do need to enter a critical section here just to obtain a valid // cs token, even though we know no other interrupt could pre-empt // this one. interrupt::free(|cs| COUNTER.reset(cs)); // We could use unsafe code to generate a fake CriticalSection if we // really wanted to, avoiding the overhead: // let cs = unsafe { interrupt::CriticalSection::new() };
} Hemos movido nuestro código inseguro (unsafe) al interior de nuestra abstracción cuidadosamente planificada, y ahora el código de nuestra aplicación no contiene ningún bloque inseguro (unsafe). Este diseño requiere que la aplicación pase un token CriticalSection: estos tokens sólo son generados de forma segura por interrupt::free, así que al requerir que se pase uno, nos aseguramos de que estamos operando dentro de una sección crítica, sin tener que hacer el bloqueo nosotros mismos. Esta garantía la proporciona estáticamente el compilador: no habrá ninguna sobrecarga en tiempo de ejecución asociada a cs. Si tuviéramos múltiples contadores, a todos se les podría dar el mismo cs, sin necesidad de múltiples secciones críticas anidadas. Esto también trae a colación un tema importante para la concurrencia en Rust: los traits Send y Sync . Para resumir el libro de Rust, un tipo es Send cuando puede ser movido con seguridad a otro hilo, mientras que es Sync cuando puede ser compartido con seguridad entre múltiples hilos. En un contexto embebido, consideramos que las interrupciones se ejecutan en un hilo separado del código de la aplicación, por lo que las variables accedidas tanto por una interrupción como por el código principal deben ser Sync. Para la mayoría de los tipos en Rust, ambos traits se derivan automáticamente por el compilador. Sin embargo, debido a que CSCounter contiene una UnsafeCell , no es Sync, y por lo tanto no podríamos hacer un static CSCounter: las variables static deben ser Sync, ya que pueden ser accedidas por múltiples hilos. Para indicar al compilador que nos hemos asegurado de que el CSCounter es seguro para compartir entre hilos, implementamos el rasgo Sync explícitamente. Al igual que con el uso anterior de secciones críticas, esto sólo es seguro en plataformas mononúcleo: con múltiples núcleos, tendrías que ir más lejos para garantizar la seguridad.

