Hemos creado una abstracción útil específica para nuestro problema de contadores, pero hay muchas abstracciones comunes utilizadas para la concurrencia. Una de estas primitivas de sincronización es un mutex, abreviatura de exclusión mutua. Estas construcciones aseguran el acceso exclusivo a una variable, como nuestro contador. Un hilo puede intentar bloquear (o adquirir ) el mutex, y o bien lo consigue inmediatamente, o se bloquea esperando a que se adquiera el bloqueo, o devuelve un error de que el mutex no se ha podido bloquear. Mientras ese hilo mantiene el bloqueo, se le concede acceso a los datos protegidos. Cuando el hilo termina, desbloquea (o libera ) el mutex, permitiendo que otro hilo lo bloquee. En Rust, normalmente implementaríamos el desbloqueo usando el rasgo Drop para asegurarnos de que siempre se libera cuando el mutex sale del ámbito. Usar un mutex con manejadores de interrupciones puede ser complicado: normalmente no es aceptable que el manejador de interrupciones se bloquee, y sería especialmente desastroso que se bloqueara esperando a que el hilo principal liberara un bloqueo, ya que entonces nos deadlock (el hilo principal nunca liberará el bloqueo porque la ejecución permanece en el manejador de interrupciones). El deadlock no se considera inseguro: es posible incluso en Rust seguro. Para evitar completamente este comportamiento, podríamos implementar un mutex que requiera una sección crítica para bloquearse, como en nuestro ejemplo del contador. Mientras la sección crítica dure lo mismo que el bloqueo, podemos estar seguros de que tenemos acceso exclusivo a la variable envuelta sin necesidad de seguir el estado de bloqueo/desbloqueo del mutex. De hecho, ¡esto lo hace por nosotros la crate cortex_m! Podríamos haber escrito nuestro contador usándolo: use core::cell::Cell;
use cortex_m::interrupt::Mutex; static COUNTER: Mutex<Cell<u32>> = Mutex::new(Cell::new(0)); #[entry]
fn main() -> ! { set_timer_1hz(); let mut last_state = false; loop { let state = read_signal_level(); if state && !last_state { interrupt::free(|cs| COUNTER.borrow(cs).set(COUNTER.borrow(cs).get() + 1)); } last_state = state; }
} #[interrupt]
fn timer() { // We still need to enter a critical section here to satisfy the Mutex. interrupt::free(|cs| COUNTER.borrow(cs).set(0));
} Ahora estamos utilizando Cell , que junto con su hermano RefCell se utiliza para proporcionar mutabilidad interior segura. Ya hemos visto UnsafeCell que es la capa inferior de mutabilidad interior en Rust: te permite obtener múltiples referencias mutables a su valor, pero sólo con código inseguro. Una Cell es como una UnsafeCell pero proporciona una interfaz segura: sólo permite tomar una copia del valor actual o reemplazarlo, no tomar una referencia, y como no es Sync, no puede ser compartida entre hilos. Estas restricciones hacen que su uso sea seguro, pero no podríamos usarlo directamente en una variable static ya que una static debe ser Sync. ¿Por qué funciona el ejemplo anterior? El Mutex<T> implementa Sync para cualquier T que sea Send - como una Cell. Puede hacer esto de forma segura porque sólo da acceso a su contenido durante una sección crítica. Por lo tanto, podemos obtener un contador seguro sin código inseguro. Esto es genial para tipos simples como el u32 de nuestro contador, pero ¿qué pasa con tipos más complejos que no son Copy? Un ejemplo extremadamente común en un contexto embebido es una estructura periférica, que generalmente no es Copy. Para eso, podemos recurrir a RefCell.

116.body:
Las crates de dispositivos generadas usando svd2rust y abstracciones similares proporcionan un acceso seguro a los periféricos al imponer que sólo una instancia de la estructura periférica puede existir a la vez. Esto garantiza la seguridad, pero dificulta el acceso a un periférico tanto desde el hilo principal como desde un manejador de interrupciones. Para compartir de forma segura el acceso a los periféricos, podemos utilizar el Mutex que vimos antes. También necesitaremos usar RefCell , que utiliza una comprobación en tiempo de ejecución para asegurar que sólo se da una referencia a un periférico cada vez. Esto tiene más sobrecarga que el simple Cell, pero ya que estamos dando referencias en lugar de copias, debemos estar seguros de que sólo existe una a la vez. Por último, también tendremos que tener en cuenta la forma de mover el periférico a la variable compartida después de que se haya inicializado en el código principal. Para ello podemos utilizar el tipo Option, inicializado a None y posteriormente establecido a la instancia del periférico. use core::cell::RefCell;
use cortex_m::interrupt::{self, Mutex};
use stm32f4::stm32f405; static MY_GPIO: Mutex<RefCell<Option<stm32f405::GPIOA>>> = Mutex::new(RefCell::new(None)); #[entry]
fn main() -> ! { // Obtain the peripheral singletons and configure it. // This example is from an svd2rust-generated crate, but // most embedded device crates will be similar. let dp = stm32f405::Peripherals::take().unwrap(); let gpioa = &dp.GPIOA; // Some sort of configuration function. // Assume it sets PA0 to an input and PA1 to an output. configure_gpio(gpioa); // Store the GPIOA in the mutex, moving it. interrupt::free(|cs| MY_GPIO.borrow(cs).replace(Some(dp.GPIOA))); // We can no longer use `gpioa` or `dp.GPIOA`, and instead have to // access it via the mutex. // Be careful to enable the interrupt only after setting MY_GPIO: // otherwise the interrupt might fire while it still contains None, // and as-written (with `unwrap()`), it would panic. set_timer_1hz(); let mut last_state = false; loop { // We'll now read state as a digital input, via the mutex let state = interrupt::free(|cs| { let gpioa = MY_GPIO.borrow(cs).borrow(); gpioa.as_ref().unwrap().idr.read().idr0().bit_is_set() }); if state && !last_state { // Set PA1 high if we've seen a rising edge on PA0. interrupt::free(|cs| { let gpioa = MY_GPIO.borrow(cs).borrow(); gpioa.as_ref().unwrap().odr.modify(|_, w| w.odr1().set_bit()); }); } last_state = state; }
} #[interrupt]
fn timer() { // This time in the interrupt we'll just clear PA0. interrupt::free(|cs| { // We can use `unwrap()` because we know the interrupt wasn't enabled // until after MY_GPIO was set; otherwise we should handle the potential // for a None value. let gpioa = MY_GPIO.borrow(cs).borrow(); gpioa.as_ref().unwrap().odr.modify(|_, w| w.odr1().clear_bit()); });
} Es mucho para asimilar, así que vamos a desglosar las líneas importantes. static MY_GPIO: Mutex<RefCell<Option<stm32f405::GPIOA>>> = Mutex::new(RefCell::new(None)); Nuestra variable compartida es ahora un Mutex alrededor de una RefCell que contiene una Option. El Mutex asegura que sólo tenemos acceso durante una sección crítica, y por lo tanto hace que la variable sea Sync, a pesar de que una RefCell normal no sería Sync. La RefCell nos da mutabilidad interior con referencias, que necesitaremos para usar nuestro GPIOA. La Option nos permite inicializar esta variable a algo vacío, y sólo después realmente mover la variable. No podemos acceder al singleton periférico estáticamente, sólo en tiempo de ejecución, así que esto es necesario. interrupt::free(|cs| MY_GPIO.borrow(cs).replace(Some(dp.GPIOA))); Dentro de una sección crítica podemos llamar a borrow() en el mutex, que nos da una referencia a la RefCell. Luego llamamos a replace() para mover nuestro nuevo valor a la RefCell. interrupt::free(|cs| { let gpioa = MY_GPIO.borrow(cs).borrow(); gpioa.as_ref().unwrap().odr.modify(|_, w| w.odr1().set_bit());
}); Por último, utilizamos MY_GPIO de forma segura y concurrente. La sección crítica evita que la interrupción se dispare como de costumbre, y nos permite tomar prestado el mutex. La RefCell nos da una &Option<GPIOA>, y controla cuánto tiempo permanece prestada - una vez que la referencia sale del ámbito, la RefCell se actualiza para indicar que ya no está prestada. Como no podemos mover el GPIOA fuera de &Option, tenemos que convertirlo en un &Option<&GPIOA> con as_ref(), que finalmente podemos unwrap() para obtener el &GPIOA que nos permite modificar el periférico. Si necesitamos una referencia mutable a un recurso compartido, entonces debemos usar borrow_mut y deref_mut en su lugar. El siguiente código muestra un ejemplo utilizando el temporizador TIM2. use core::cell::RefCell;
use core::ops::DerefMut;
use cortex_m::interrupt::{self, Mutex};
use cortex_m::asm::wfi;
use stm32f4::stm32f405; static G_TIM: Mutex<RefCell<Option<Timer<stm32::TIM2>>>> = Mutex::new(RefCell::new(None)); #[entry]
fn main() -> ! { let mut cp = cm::Peripherals::take().unwrap(); let dp = stm32f405::Peripherals::take().unwrap(); // Some sort of timer configuration function. // Assume it configures the TIM2 timer, its NVIC interrupt, // and finally starts the timer. let tim = configure_timer_interrupt(&mut cp, dp); interrupt::free(|cs| { G_TIM.borrow(cs).replace(Some(tim)); }); loop { wfi(); }
} #[interrupt]
fn timer() { interrupt::free(|cs| { if let Some(ref mut tim)) = G_TIM.borrow(cs).borrow_mut().deref_mut() { tim.start(1.hz()); } });
} ¡Uf! Esto es seguro, pero también es un poco difícil de manejar. ¿Hay algo más que podamos hacer?

