La crate alloc viene con la distribución estándar de Rust. Para importar la crate puedes usarla directamente sin declararla como dependencia en tu archivo Cargo.toml. #![feature(alloc)] extern crate alloc; use alloc::vec::Vec; Para poder utilizar cualquier colección primero tendrás que utilizar el atributo global_allocator para declarar el asignador global que utilizará tu programa. Es necesario que el asignador que selecciones implemente el trait GlobalAlloc . Para completar y mantener esta sección lo más autocontenida posible, implementaremos un simple asignador de punteros y lo usaremos como asignador global. Sin embargo, te sugerimos encarecidamente que utilices un asignador probado en batalla que esté en crates.io en tu programa en lugar de este asignador. // Bump pointer allocator implementation use core::alloc::{GlobalAlloc, Layout};
use core::cell::UnsafeCell;
use core::ptr; use cortex_m::interrupt; // Bump pointer allocator for *single* core systems
struct BumpPointerAlloc { head: UnsafeCell<usize>, end: usize,
} unsafe impl Sync for BumpPointerAlloc {} unsafe impl GlobalAlloc for BumpPointerAlloc { unsafe fn alloc(&self, layout: Layout) -> *mut u8 { // `interrupt::free` is a critical section that makes our allocator safe // to use from within interrupts interrupt::free(|_| { let head = self.head.get(); let size = layout.size(); let align = layout.align(); let align_mask = !(align - 1); // move start up to the next alignment boundary let start = (*head + align - 1) & align_mask; if start + size > self.end { // a null pointer signal an Out Of Memory condition ptr::null_mut() } else { *head = start + size; start as *mut u8 } }) } unsafe fn dealloc(&self, _: *mut u8, _: Layout) { // this allocator never deallocates memory }
} // Declaration of the global memory allocator
// NOTE the user must ensure that the memory region `[0x2000_0100, 0x2000_0200]`
// is not used by other parts of the program
#[global_allocator]
static HEAP: BumpPointerAlloc = BumpPointerAlloc { head: UnsafeCell::new(0x2000_0100), end: 0x2000_0200,
}; Además de seleccionar un asignador global, el usuario también tendrá que definir cómo se gestionan los errores de falta de memoria (OOM) usando el atributo unstable alloc_error_handler. #![feature(alloc_error_handler)] use cortex_m::asm; #[alloc_error_handler]
fn on_oom(_layout: Layout) -> ! { asm::bkpt(); loop {}
} Una vez que todo esto está en su lugar, el usuario puede finalmente utilizar las colecciones en alloc. #[entry]
fn main() -> ! { let mut xs = Vec::new(); xs.push(42); assert!(xs.pop(), Some(42)); loop { // .. }
} Si has usado las colecciones en la crate std entonces estas te serán familiares ya que son exactamente la misma implementación.

