heapless no requiere configuración ya que sus colecciones no dependen de un asignador de memoria global. Simplemente use sus colecciones y procede a instanciarlas: // heapless version: v0.4.x
use heapless::Vec;
use heapless::consts::*; #[entry]
fn main() -> ! { let mut xs: Vec<_, U8> = Vec::new(); xs.push(42).unwrap(); assert_eq!(xs.pop(), Some(42)); loop {}
} Notarás dos diferencias entre estas colecciones y las de alloc. Primero, tienes que declarar por adelantado la capacidad de la colección. Las colecciones heapless nunca se reasignan y tienen capacidades fijas; esta capacidad forma parte de la firma de tipo de la colección. En este caso hemos declarado que xs tiene una capacidad de 8 elementos, es decir, que el vector puede contener, como máximo, 8 elementos. Esto se indica mediante la U8 (véase typenum ) en la firma de tipo. En segundo lugar, el método push, y muchos otros métodos, devuelven un Result. Dado que las colecciones heapless tienen una capacidad fija, todas las operaciones que insertan elementos en la colección pueden fallar potencialmente. La API refleja este problema devolviendo un Result que indica si la operación ha tenido éxito o no. Por el contrario, las colecciones alloc se reasignan a sí mismas en el heap para aumentar su capacidad. A partir de la versión v0.4.x todas las colecciones heapless almacenan todos sus elementos en línea. Esto significa que una operación como let x = heapless::Vec::new(); asignará la colección en la pila, pero también es posible asignar la colección en una variable static, o incluso en el montón (Box<Vec<_, _>>).

