En C probablemente estés acostumbrado a acceder a arrays directamente por su índice: int16_t arr[16];
int i;
for(i=0; i<sizeof(arr)/sizeof(arr[0]); i++) { process(arr[i]);
} En Rust esto es un anti-patrón: el acceso indexado puede ser más lento (ya que necesita ser comprobado) y puede impedir varias optimizaciones del compilador. Esta es una distinción importante y vale la pena repetirla: Rust comprobará los accesos fuera de los límites en la indexación manual de arrays para garantizar la seguridad de la memoria, mientras que C indexará alegremente fuera del array. En su lugar, usa iteradores: let arr = [0u16; 16];
for element in arr.iter() { process(*element);
} Los iteradores proporcionan una potente gama de funcionalidades que tendrías que implementar manualmente en C, como encadenar, comprimir, enumerar, encontrar el mínimo o el máximo, sumar, y más. Los métodos de los iteradores también pueden encadenarse, lo que proporciona un código de procesamiento de datos muy legible. Consulte Iteradores en el libro y Documentación de los Iteradores para obtener más información.

