En C, las variables individuales pueden ser marcadas como volatile, indicando al compilador que el valor de la variable puede cambiar entre accesos. Las variables volátiles se usan comúnmente en un contexto embebido para registros mapeados en memoria. En Rust, en lugar de marcar una variable como volatile, usamos métodos específicos para realizar accesos volátiles: core::ptr::read_volatile y core::ptr::write_volatile . Estos métodos toman un *const T o un *mut T ( raw pointers , como se ha comentado anteriormente) y realizan una lectura o escritura volátil. Por ejemplo, en C podrías escribir volatile bool signalled = false; void ISR() { // Señal de que se ha producido la interrupción signalled = true;
} void driver() { while(true) { // Dormir hasta la señal while(!signalled) { WFI(); } // Resetear la bandera de la señal signalled = false; // Realizar alguna tarea que estaba a la espera de la interrupción run_task(); }
} El equivalente en Rust usaría métodos volátiles en cada acceso: static mut SIGNALLED: bool = false; #[interrupt]
fn ISR() { // Señal de que se ha producido la interrupción // (En condiciones reales, debes considerar una primitiva de alto nivel, // tal como un tipo atómico (atomic type)). unsafe { core::ptr::write_volatile(&mut SIGNALLED, true) };
} fn driver() { loop { // Dormir hasta la señal while unsafe { !core::ptr::read_volatile(&SIGNALLED) } {} // Resetear la bandera de la señal unsafe { core::ptr::write_volatile(&mut SIGNALLED, false) }; // Realizar alguna tarea que estaba a la espera de la interrupción run_task(); }
} Vale la pena notar algunas cosas en el ejemplo de código: Podemos pasar &mut SIGNALLED a la función que requiere *mut T, ya que &mut T se convierte automáticamente en *mut T (y lo mismo para *const T) Necesitamos bloques unsafe para los métodos read_volatile/write_volatile, ya que son funciones unsafe. Es responsabilidad del programador garantizar un uso seguro: consulte la documentación de los métodos para más detalles. Es raro que necesites estas funciones directamente en tu código, ya que normalmente se encargarán de ellas las bibliotecas de alto nivel. Para los periféricos mapeados en memoria, las crates de acceso a periféricos implementarán el acceso volátil automáticamente, mientras que para las primitivas de concurrencia hay mejores abstracciones disponibles (ver el capítulo de concurrencia ).

