En C embebido es común decirle al compilador que una variable debe tener una cierta alineación o que una estructura debe estar empaquetada en lugar de alineada, normalmente para cumplir requisitos específicos de hardware o protocolo. En Rust esto se controla mediante el atributo repr de una estructura o unión. La representación por defecto no ofrece garantías de disposición, por lo que no debe utilizarse para código que interopera con hardware o C. El compilador puede reordenar los miembros de la estructura o insertar relleno y el comportamiento puede cambiar con futuras versiones de Rust. struct Foo { x: u16, y: u8, z: u16,
} fn main() { let v = Foo { x: 0, y: 0, z: 0 }; println!("{:p} {:p} {:p}", &v.x, &v.y, &v.z);
} // 0x7ffecb3511d0 0x7ffecb3511d4 0x7ffecb3511d2
// Nota que el orden se cambió a x, z, y para mejorar el empaquetado. Para asegurar diseños interoperables con C, use repr(C): #[repr(C)]
struct Foo { x: u16, y: u8, z: u16,
} fn main() { let v = Foo { x: 0, y: 0, z: 0 }; println!("{:p} {:p} {:p}", &v.x, &v.y, &v.z);
} // 0x7fffd0d84c60 0x7fffd0d84c62 0x7fffd0d84c64
// El orden se preserva y la disposición no cambiará en el tiempo.
// `z` es alineado a dos bytes por lo que un byte de relleno existe entre `y` y `z`. Para asegurar una representación empaquetada, use repr(packed): #[repr(packed)]
struct Foo { x: u16, y: u8, z: u16,
} fn main() { let v = Foo { x: 0, y: 0, z: 0 }; // La referencias siempre deben estar alineadas, por lo tanto para revisar // las direcciones de los campos de las estructuras, usamos `std::ptr::addr_of!()` // para obtener un puntero crudo en lugar de sólo imprimir `&v.x`. let px = std::ptr::addr_of!(v.x); let py = std::ptr::addr_of!(v.y); let pz = std::ptr::addr_of!(v.z); println!("{:p} {:p} {:p}", px, py, pz);
} // 0x7ffd33598490 0x7ffd33598492 0x7ffd33598493
// No se ha insertado relleno entre `y` y `z`, por lo tanto, ahora `z` está desalineado. Tenga en cuenta que el uso de repr(packed) también establece la alineación del tipo a 1. Finalmente, para especificar una alineación concreta, usa repr(align(n)), donde n es el número de bytes a alinear (y debe ser una potencia de dos): #[repr(C)]
#[repr(align(4096))]
struct Foo { x: u16, y: u8, z: u16,
} fn main() { let v = Foo { x: 0, y: 0, z: 0 }; let u = Foo { x: 0, y: 0, z: 0 }; println!("{:p} {:p} {:p}", &v.x, &v.y, &v.z); println!("{:p} {:p} {:p}", &u.x, &u.y, &u.z);
} // 0x7ffec909a000 0x7ffec909a002 0x7ffec909a004
// 0x7ffec909b000 0x7ffec909b002 0x7ffec909b004
// Las dos instancias `u` y `v` han sido colocadas en alineamientos de 4096 bytes,
// evidenciado por el `000` al final de sus direcciones. Observe que podemos combinar repr(C) con repr(align(n)) para obtener una disposición alineada y compatible con C. No es permisible combinar repr(align(n)) con repr(packed), ya que repr(packed) establece la alineación a 1. Tampoco está permitido que un tipo repr(packed) contenga un tipo repr(align(n)). Para más detalles sobre la disposición de tipos, consulta el capítulo disposición de tipos de la Referencia de Rust.

