Típicamente, las bibliotecas escritas en C o C++ proporcionan un fichero de cabecera que define todos los tipos y funciones utilizados en las interfaces públicas. Un archivo de ejemplo puede tener este aspecto: /* File: cool.h */
typedef struct CoolStruct { int x; int y;
} CoolStruct; void cool_function(int i, char c, CoolStruct* cs); Traducida a Rust, esta interfaz quedaría así: /* File: cool_bindings.rs */
#[repr(C)]
pub struct CoolStruct { pub x: cty::c_int, pub y: cty::c_int,
} extern "C" { pub fn cool_function( i: cty::c_int, c: cty::c_char, cs: *mut CoolStruct );
} Echemos un vistazo a esta definición pieza por pieza, para explicar cada una de las partes. #[repr(C)]
pub struct CoolStruct { ... } Por defecto, Rust no garantiza el orden, el relleno o el tamaño de los datos incluidos en una struct. Para garantizar la compatibilidad con el código C, incluimos el atributo #[repr(C)], que indica al compilador de Rust que utilice siempre las mismas reglas que C para organizar los datos dentro de una estructura. pub x: cty::c_int,
pub y: cty::c_int, Debido a la flexibilidad de cómo C o C++ definen un int o un char, se recomienda usar tipos de datos primitivos definidos en cty, que mapeará tipos de C a tipos en Rust. extern "C" { pub fn cool_function( ... ); } Esta sentencia define la firma de una función que usa la ABI de C, llamada cool_function. Al definir la firma sin definir el cuerpo de la función, la definición de esta función necesitará ser proporcionada en otro lugar, o enlazada en la librería final o binaria desde una librería estática. i: cty::c_int, c: cty::c_char, cs: *mut CoolStruct Al igual que en el caso anterior, definimos los tipos de datos de los argumentos de las funciones utilizando definiciones compatibles con C. También mantenemos los mismos nombres de argumentos para mayor claridad. Aquí tenemos un nuevo tipo, *mut CoolStruct. Como C no tiene el concepto de referencias de Rust, que se vería así: &mut CoolStruct, en su lugar tenemos un puntero crudo. Como hacer referencia a este puntero es unsafe, y el puntero puede ser de hecho un puntero null, hay que tener cuidado para asegurar las garantías típicas de Rust cuando se interactúa con código C o C++.

