} Este programa usa algo llamado semihosting para imprimir texto en la consola host . Cuando se usa hardware real esto requiere una sesión de depuración pero cuando se usa QEMU esto simplemente funciona. Empecemos compilando el ejemplo: cargo build --example hello El binario de salida estará localizado en target/thumbv7m-none-eabi/debug/examples/hello. Para ejecutar este binario en QEMU ejecute el siguiente comando: qemu-system-arm \ -cpu cortex-m3 \ -machine lm3s6965evb \ -nographic \ -semihosting-config enable=on,target=native \ -kernel target/thumbv7m-none-eabi/debug/examples/hello Hello, world! El comando debería salir con éxito (código de salida = 0) después de imprimir el texto. En *nix puedes comprobarlo con el siguiente comando: echo $? 0 Vamos a desglosar ese comando QEMU: qemu-system-arm. Este es el emulador QEMU. Hay algunas variantes de estos binarios QEMU; éste hace una emulación completa del sistema de máquinas ARM , de ahí el nombre. -cpu cortex-m3. Esto le dice a QEMU que emule una CPU Cortex-M3. Especificar el modelo de CPU nos permite detectar algunos errores de compilación: por ejemplo, ejecutar un programa compilado para Cortex-M4F, que tiene una FPU por hardware, hará que QEMU se equivoque durante su ejecución. -machine lm3s6965evb. Esto le dice a QEMU que emule el LM3S6965EVB, una tarjeta de evaluación que contiene un microcontrolador LM3S6965. -nographic. Esto le dice a QEMU que no lance su GUI. -semihosting-config (..). Esto le dice a QEMU que habilite semihosting. Semihosting permite al dispositivo emulado, entre otras cosas, utilizar el stdout, stderr y stdin del host y crear archivos en el host. -kernel $file. Esto le dice a QEMU qué binario cargar y ejecutar en la máquina emulada. ¡Escribir ese largo comando QEMU es demasiado trabajo! Podemos configurar un runner personalizado para simplificar el proceso. El archivo .cargo/config.toml tiene un runner comentado que invoca a QEMU; vamos a descomentarlo: head -n3 .cargo/config.toml [target.thumbv7m-none-eabi]
