La crate HAL para un chip funciona típicamente implementando un Trait personalizado para las estructuras crudas expuestas por la PAC. A menudo este trait definirá una función llamada constrain() para periféricos simples o split() para cosas como puertos GPIO con múltiples pines. Esta función consumirá la estructura subyacente del periférico y devolverá un nuevo objeto con una API de alto nivel. Esta API también puede hacer cosas como que la función new del puerto serie requiera un préstamo en alguna estructura Clock, que sólo puede ser generada llamando a la función que configura los PLLs y establece todas las frecuencias de reloj. De esta forma, es estáticamente imposible crear un objeto puerto serie sin haber configurado antes las frecuencias de reloj, o que el objeto puerto serie convierta erróneamente la velocidad de transmisión en ticks de reloj. Algunas crates incluso definen rasgos especiales para los estados en los que puede estar cada pin GPIO, requiriendo que el usuario ponga un pin en el estado correcto (digamos, seleccionando el Modo de Función Alternativo apropiado) antes de pasar el pin a Periférico. Todo ello sin costo alguno en tiempo de ejecución. Veamos un ejemplo: #![no_std]
#![no_main] use panic_halt as _; // panic handler use cortex_m_rt::entry;
