Las excepciones, y las interrupciones, son un mecanismo de hardware mediante el cual el procesador gestiona eventos asíncronos y errores fatales (p.e. la ejecución de una instrucción no válida). Las excepciones implican prioridad e involucran manejadores de excepciones, subrutinas ejecutadas en respuesta a la señal que desencadenó el evento. La crate cortex-m-rt proporciona un atributo exception para declarar los manejadores de excepciones. // Exception handler for the SysTick (System Timer) exception
#[exception]
fn SysTick() { // ..
} Aparte del atributo exception los manejadores de excepciones parecen funciones simples pero hay una diferencia más: Los manejadores de excepciones no pueden ser llamados por software. Siguiendo el ejemplo anterior, la sentencia SysTick(); produciría un error de compilación. Este comportamiento es intencionado y es necesario para proporcionar una característica: las variables static mut declaradas dentro de los manejadores de exception son seguras de usar. #[exception]
fn SysTick() { static mut COUNT: u32 = 0; // `COUNT` has transformed to type `&mut u32` and it's safe to use *COUNT += 1;
} Como sabrás, usar variables static mut en una función la convierte en non-reentrant . Es un comportamiento indefinido llamar a una función no-reentrante, directa o indirectamente, desde más de un manejador de excepciones / interrupciones o desde main y uno o más manejadores de excepciones / interrupciones. Rust seguro nunca debe dar lugar a un comportamiento indefinido por lo que las funciones no reentrantes deben ser marcadas como unsafe. Sin embargo, me acaban de decir que los manejadores de excepciones pueden usar variables static mut de forma segura. ¿Cómo es esto posible? Esto es posible porque los manejadores de excepción no pueden ser llamados por software, por lo que la reentrada no es posible. Tenga en cuenta que el atributo exception transforma las definiciones de variables estáticas dentro de la función envolviéndolas en bloques "inseguros" y proporcionándonos con nuevas variables apropiadas de tipo &mut del mismo nombre. De este modo podemos derefenciar la referencia mediante * para acceder a los valores de las variables sin necesidad de envolverlas en bloques de tipo unsafe.

