Ahora, hay un par de problemas con el enfoque anterior. Tenemos que usar unsafe cada vez que queramos acceder a nuestro Periférico. No tenemos forma de especificar qué registros son de solo lectura o de lectura y escritura. Cualquier pieza de código en cualquier parte de tu programa podría acceder al hardware a través de esta estructura. Aún más importante, esto en realidad no funciona... Ahora, el problema es que los compiladores son inteligentes. Si realiza dos escrituras en la misma pieza de RAM, una tras otra, el compilador puede notarlo y omitir la primera escritura por completo. En C, podemos marcar las variables como "volátiles" para garantizar que cada lectura o escritura ocurra según lo previsto. En Rust, en cambio, marcamos los accesos como volátiles, no como variables. let systick = unsafe { &mut *(0xE000_E010 as *mut SysTick) };
let time = unsafe { core::ptr::read_volatile(&mut systick.cvr) }; Entonces, hemos solucionado uno de nuestros cuatro problemas, ¡pero ahora tenemos aún más código no seguro! Afortunadamente, hay una crate de terceros que puede ayudar: registro_volatil . use volatile_register::{RW, RO}; #[repr(C)]
struct SysTick { pub csr: RW<u32>, pub rvr: RW<u32>, pub cvr: RW<u32>, pub calib: RO<u32>,
} fn get_systick() -> &'static mut SysTick { unsafe { &mut *(0xE000_E010 as *mut SysTick) }
} fn get_time() -> u32 { let systick = get_systick(); systick.cvr.read()
} Ahora, los accesos volátiles se realizan automáticamente a través de los métodos read y write. Todavía es inseguro realizar escrituras, pero para ser justos, el hardware es un montón de estados mutables y no hay forma de que el compilador sepa si estas escrituras son realmente seguras, por lo que esta es una buena posición inicial.

