El concepto de typestates describe la codificación de información sobre el estado actual de un objeto en el tipo de ese objeto. Aunque esto puede sonar un poco arcano, si ha usado Patrón Constructor en Rust, ¡ya ha comenzado a usar Typestate Programming! pub mod foo_module { #[derive(Debug)] pub struct Foo { inner: u32, } pub struct FooBuilder { a: u32, b: u32, } impl FooBuilder { pub fn new(starter: u32) -> Self { Self { a: starter, b: starter, } } pub fn double_a(self) -> Self { Self { a: self.a * 2, b: self.b, } } pub fn into_foo(self) -> Foo { Foo { inner: self.a + self.b, } } }
